          "Polres Metro Jakarta Timur kembali menjadwalkan ulang klarifikasi terhadap musisiSherina Munafuntuk dimintai terkait unggahannya di media sosial soal penyelamatan seekor kucing milik anggota DPR RIUya Kuya, Jumat (12/9). Sherina mulanya dijadwalkan untuk diklarifikasi pada Senin (8/9), namun ia berhalangan hadir. Sherina kembali dijadwalkan diklarifikasi pada Selasa (9/9), namun masih belum bisa memenuhi panggilan. \"(Pemanggilan ulang) Jumat besok jam 10.00 WIB pagi,\" kata Kapolres Metro Jakarta Timur, Kombes Alfian Nurrizal kepada wartawan, Rabu (10/9). ADVERTISEMENT SCROLL TO CONTINUE WITH CONTENT Disampaikan Alfian, penjadwalkan ulang klarifikasi ini berdasarkan permintaan Sherina melalui kuasa hukumnya. Namun, Alfian tak membeberkan soal alasan Sherina meminta penjadwalan ulang. \"Yang meminta jadwal ulang lawyernya itu. Katanya penyidik saya, ini ke penyidik, jadi kemarin yang bersangkutan enggak bisa hadir, minta dijadwalkan lagi, sehingga kita jadwalkan hari Jumat, kita layangkan surat lagi Jumat gitu,\" tutur dia. Sebelumnya, Sherina Munaf membagikan kabar terbaru soal penyelamatan kucing milik Uya Kuya bernama Lili yang sudah ditemukan. \"Salah satu kucing dari rumah Uya Kuya ada yang rescue dan semalaman saya dan @indiradiandra sudah koordinasi langsung dengan rescuer. Pagi ini dijemput dan sekarang kucing posisi aman, sedang sayafoster. Ini hanya satu ekor dari kemungkinan 16-20an ekor kucing yangdibreedingdi lokasi tersebut,\" tulis Sherina. Sherina juga mendeskripsikan kondisi kucing yang diduga milik Uya Kuya tersebut. \"Kondisi: sangat kurus, tulang-tulangnya berasa banget kalau lagi di pet badannya. Untuk para pet owners,pleasesebisa mungkin ADOPTdon'tSHOP, steril kucingnya, kalau tak mampu rawat tak usah pelihara,\" lanjut unggahan Sherina. Dalam kasus penjarahan rumah Uya Kuya, Polres Metro Jakarta Timur diketahui telah menetapkan 12 orang sebagai tersangka. Para tersangka ini memiliki peran berbeda, mulai dari provokator, pelaku penjarahan dan penyerangan kepada petugas.",
          "Bagi penderitakolesteroldan asam urat, menjaga polamakansangatlah penting. Makanan yang tinggi kolesterol dan purin harus dihindari karena dapat memperburuk kondisi kesehatan. Namun, hampir semua makanan hewani mengandung kolesterol dan purin dalam kadar tertentu, sehingga Anda harus lebih jeli dalam memilih makanan ini. Salah satu sumber protein yang banyak digemari adalah ikan. Namun tidak semua jenis ikan cocok untuk dikonsumsi oleh penderita kolesterol dan asam urat. ADVERTISEMENT SCROLL TO CONTINUE WITH CONTENT Untungnya, ada beberapa ikan yang boleh dimakan penderita kolesterol dan asam urat karena kandungan kolesterol dan purinnya relatif rendah. Meski demikian, Anda tetap harus bijak dalam mengatur porsi makan agar manfaat nutrisi dari ikan tetap optimal tanpa membahayakan kesehatan. MenurutCleveland Clinic, makanan yang dianggap rendah purin, adalah makanan yang mengandung kurang dari 100 miligram (mg) purin per 100 gram. Lantas, bagaimana dengan batas kolesterol yang aman? MengutipUCSF Health, bagi orang dengan faktor risiko penyakit jantung, sebaiknya tidak mengonsumsi lebih dari 200 mg kolesterol per hari. Jika Anda tidak ada faktor risiko penyakit jantung, sebaiknya tetap batasi konsumsi makanan berkolesterol, yakni tidak lebih dari 300 mg per hari. Merangkum dari berbagai sumber, berikut ini daftar lima ikan yang tergolong aman dan boleh dikonsumsi oleh penderita kolesterol dan asam urat: Ikan kod merupakan salah satu pilihan terbaik untuk penderita kolesterol dan asam urat. MengutipFoodstruct, kod mengandung sekitar 66 mg kolesterol dan 71 mg purin per porsi 100 gram. Selain itu, ikan kod kaya akan asam lemak omega-3 yang bermanfaat menurunkan kadar trigliserida dan meningkatkan kolesterol baik (HDL). Omega-3 juga membantu mencegah penggumpalan trombosit yang dapat menyumbat pembuluh darah dan menjaga kesehatan jantung tetap optimal. Ikan haddock yang masih satu famili dengan kod, memiliki rasa ringan dan tekstur daging yang lembut serta lembap. Ikan ini mengandung 55 mg kolesterol dan 59 mg purin per 100 gram, menjadikannya pilihan yang aman untuk penderita kolesterol serta asam urat. Selain itu,haddock kaya akan vitamin B12, B6, dan B3 yang sangat penting untuk metabolisme energi dan fungsi saraf. Ikan perch atau kerakap mengandung 115 mg kolesterol dan 67 mg purin per 100 gram. Meski tampak banyak, jumlah kolesterol ini 3,2 kali lebih rendah dibandingkan telur, sehingga aman dikonsumsi dalam batas wajar.\u00a0Perch juga tinggi akan asam lemak omega-3 dan omega-6 yang bermanfaat untuk kesehatan jantung, mata, serta sistem imun tubuh. Tilapia merupakan ikan air tawar yang populer dan mengandung 57 mg kolesterol serta 60 mg purin per 100 gram. Selain rendah kalori, tilapia juga kaya protein dengan kandungan sekitar 26 gram protein dalam setiap 100 gram. MelansirHealthline, ikan ini juga menyediakan berbagai vitamin dan mineral penting seperti niasin, vitamin B12, fosfor, selenium, dan kalium yang mendukung fungsi tubuh secara menyeluruh. Pike, atau yang dikenal sebagai ikan tombak, mengandung sekitar 39 mg kolesterol dan 59 mg purin per 100 gram. Ini menjadikannya ikan dengan kadar kolesterol dan purin yang sangat rendah. Ikan ini juga rendah lemak jenuh, sehingga baik untuk kesehatan kardiovaskular. Selain itu,pike merupakan sumber protein berkualitas tinggi, kaya akan niasin, serta mineral seperti kalium dan fosfor. Berbagai vitamin dan mineral tersebut dapat membantu mengatur detak jantung, tekanan darah, kesehatan tulang, hingga fungsi saraf. Memilih ikan yang boleh dimakan penderita kolesterol dan asam urat sangat penting untuk mencegah komplikasi penyakit. Daftar ikan di atas merupakan pilihan yang tergolong aman karena kandungan kolesterol dan purinnya rendah. Meski demikian, konsumsi tetap harus dilakukan secara bijak dengan memperhatikan porsi agar manfaat kesehatan tetap optimal.",
